import json
from classification_pipeline import classify_image
from llm_pipeline import get_dermatology_assessment

def lambda_handler(event, context):
    try:
        # Load image
        body = event.get('body', event)
        if isinstance(body, str):
            body = json.loads(body)
            
        encoded_image = body.get('image')
        
        if not encoded_image:
            return {
                'statusCode': 400,
                'body': json.dumps({'error': 'No image provided.'})
            }
        
        # Run classification 
        classification_result = classify_image(encoded_image)
        
        # Run LLM
        age = body.get('age', "Not provided")
        gender = body.get('gender', 'Not provided')  
        disease_name = classification_result.get('disease_name', "Not provided")
        
        # Run LLM assessment
        llm_assessment = get_dermatology_assessment(disease_name, age, gender)
        
        # Results
        response_body = {
            'classification': {
                'disease_name': disease_name
            },
            'llm_assessment': llm_assessment
        }
            
        return {
            'statusCode': 200,
            'body': json.dumps(response_body)
        }
        
    except Exception as e:

        print(f"Error: {str(e)}")

        return {
            'statusCode': 500,
            'body': json.dumps({'error': str(e)})
        }

if __name__ == "__main__":
    event = {
        'body': {
            "image": "data:image/jpeg;base64,"
        }
    }
    response_body = lambda_handler(event, None)
    print(response_body)